import { AlertType } from "./enums";

export type AppStore = {
  isLoading: boolean;
  showAlert: boolean;
  alertType: AlertType;
  alertText: string;
  user: {
    _id?: string;
    id?: string;
    name: string;
    email: string;
  };
  token: string;
};

export interface IContext<T extends {}> {
  data: T;
  setData: (newData: UpdateData<T>) => void;
}

export type Size = {
  width: number
  height: number;
}

export type Try = {
  row: number | null;
  column: number | null;
  number: number;
  moves: number;
}

export type GameStore = {
  currentNumber: number;
  lastTry: Try
  time: number;
  avaliableCells: number;
  fieldSize: Size;
  field: string[][];
  onCellClick: (row: number, column: number, field: string[][], lastTry: Try) => void;
};
